import Card from '../UI/Card/Card';
import classes from './Cart.module.css';
import CartItem from './CartItem';

const Cart = () => {
    return <Card className={classes['cart-items']}>
        {<CartItem name={"Schnitzel"} amount={'1'} price={'20'} />}
    </Card>
}

export default Cart;
